import React, {useState,useEffect} from "react"

import '../css/home.css';

const Home = (props) =>{
    const [windowsTrans, setWindowTrans] = useState("translateX(0px)")
    
    return(
        <div id="home">
            <div className="authSection">
                <div id="window-container">
                    <div id="window">

                    </div>
                </div>
            </div>
        </div>
    ) 

}

export default Home;
